import './App.css';
import {Button} from "react-bootstrap";
import{useNavigate} from "react-router-dom";
import Header from './components/header';
import AddTimeTable from './components/AddTimeTable';
import AllTimeTables from './components/alltimetables';
import {Router,Route} from "react-router-dom"



function App() {

  const navigate = useNavigate();
  return (
  <>
  <Header/>


      <Button onClick={() => navigate("create")}>Add Time Table</Button><br/><br/><br/>

      <Button onClick={() => navigate("all")}>All TimeTables</Button>


    <Router>
    <Route path="/create" element={<AddTimeTable/>}/>

      <Route path="/all" element={<AllTimeTables/>}/>

    </Router>





</>










  );
}


export default App;
